import React, { Component } from 'react';
import { connect } from "react-redux";
import { Redirect } from "react-router-dom";

import "./Homepage.css";

class Homepage extends Component {
  render() {
    if (!this.props.username) {
        return <Redirect to="/" />
    }

    const kindOfQuestion = this.props.match.params.kindof;
    let questions;

    if (kindOfQuestion === "answered") {
        questions = [];
    } else {
        const arrayQuestions = Object.values(this.props.questions);

        questions = arrayQuestions.map((question) => {
            return <div>
                <p>{ question.author }</p>
                <p>{ question.optionOne }</p>
                <p>{ question.optionTwo }</p>
            </div>
        });
    }

    return (
      <div>
        <h1>HOMEPAGE</h1>

      </div>
    )
  }
}

const mapStateToProps = (state) => {
  return {
    users: state.users,
    questions: state.questions,
    username: state.authedUser.username || ""
  };
}

export default connect(mapStateToProps)(Homepage);
